import styles from './Robusta.module.scss';

export default function Robusta() {
    return(
    <main className={styles.Robusta}>
        <div className={styles.banner}>What Is Robusta Coffee?<br />Robusta Coffee is coffee made from the beans of the Coffea canephora plant, the origins of which are in Africa. Robusta coffee is notoriously bitter and is used primarily in instant coffee, espresso, and as a filler in certain blends of ground coffee.</div>
    </main>
    )
}
